// src/App.js
import React from 'react';
import Header from './components/Header';
import LoginForm from './components/LoginForm.tsx';
import Hero from './components/Hero';
import ProductivityLanding from './components/LandingPage.js';
import WebsiteFooter from './components/WebsiteFooter.tsx';
import ProgressTracker from './components/ProgressTracker';
import Footer from './components/Footer';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <Router> {/* Wrap your app with Router */}
      <div className="App"> 
        <main>
          <Routes> 
            <Route path="/" element={<LandingPage />} />"
            <Route  element={<ProgressTracker />} />"
            <Route path="/" element={<Hero />} /> {/* Default route (/) renders Hero */}
            <Route path="/login" element={<LoginForm />} /> {/* /login route renders LoginForm */}
            <Route path='/' element={<WebsiteFooter />} />
            {/* Other routes can be added here */}
          </Routes>
        </main>
        {/* <Footer /> */}
      </div>
    </Router>
  );
};

export default App;
